const editData=(id,row)=>{
  handleClickOpen()
  setEditId(id)
  setIni({
    questions:row.questions,
    answer:row.answer,
    subcategoryID:row.subcategoryID?._id,
    categoryID: row.categoryID?._id
  })
}
  useEffect(()=>{
    dataView()
    handleFillsubcatagary()
  },[])
  const handleChange = (e) => {
    console.log(e.target.values);
    
    setIni((prev) => ({
      ...prev,
  
      subcategoryID: e.target.value,
     
    }));
  };

  
  return (
    <>
      <InteviewPortal>
        <Box sx={{ width: '100%', display: 'flex' }}>
          <Box
            component="form"
            sx={{ width: '80%' }}

            noValidate
            autoComplete="off"

          >
         

          </Box>
          {/* button add catagary------------------------------------------------ */}
          <Box sx={{ width: { lg: '20% ', md: '100%', sm: '100%', xs: '100%' }, justifyContent: 'center', display: 'flex', padding: '0px 35px 0px 35px' }}>
            <React.Fragment>
              <Button sx={{ backgroundColor: '#1976d2', color: 'white', width: { lg: '100%', md: '100%', sm: '100%', xs: '100%' } }} variant="outlined" onClick={handleClickOpen}>
                ADD Q & A
              </Button>
              <BootstrapDialog
                onClose={handleClose}
                aria-labelledby="customized-dialog-title"
                open={open}
              >
                <DialogTitle sx={{ m: 0, p: 2 }} id="customized-dialog-title">
                  Add Catagary
                </DialogTitle>
                <IconButton

                  aria-label="close"
                  onClick={handleClose}
                  sx={(theme) => ({
                    position: 'absolute',
                    right: 8,
                    top: 8,
                    color: theme.palette.grey[500],
                  })}
                >
                  <CloseIcon />
                </IconButton>
                <Formik
                enableReinitialize
                initialValues={ini}
                onSubmit={handleSubmit}
                >
                  <Form>
                    <DialogContent dividers>

                    <Field as={TextField} name='questions' label='Questions' fullWidth margin='dense' />
                    <Field as={TextField} name='answer' label='Answer' fullWidth margin='dense' />
                      <FormControl fullWidth margin='dense'>
                        <InputLabel id="demo-simple-select-label">sub category name</InputLabel>
                      
                        <Select
                          name="subcategoryID"
                          label="subcategoryname"
                          onChange={handleChange} 
                          value={ini.subcategoryID} 
                        >
                          {
                            list1.map((row) => (
                              <MenuItem value={row._id}>{row.subCategoryname}</MenuItem>
                            ))
                          }
                        </Select>
                      </FormControl>
                      <DialogActions>
                        <Button sx={{ backgroundColor: '#1976d2', color: 'white' }} autoFocus 
                        type='submit'
                        onClick={handleClose}>
                          Submit
                        </Button>
                      </DialogActions>
                    </DialogContent>
                  </Form>
                </Formik>
              </BootstrapDialog>
            </React.Fragment>
          </Box>
        </Box>

        <TableContainer component={Paper}>
          <Table sx={{ minWidth: { xs: 200 }, mt: '10px' }} aria-label="customized table">
            <TableHead  >
              <TableRow >
                <StyledTableCell >No.</StyledTableCell>
                <StyledTableCell align="left">Question</StyledTableCell>
                <StyledTableCell align="left">Answer</StyledTableCell>
                <StyledTableCell align="left">Sub-Catagary Name</StyledTableCell>
                <StyledTableCell align="left">Catagary Name</StyledTableCell>

                <StyledTableCell align="right">Delete</StyledTableCell>
                <StyledTableCell align="right">Update</StyledTableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {list2.map((row,i) => (
                <StyledTableRow key={i}>
                  <StyledTableCell component="th" scope="row">
                    {i+1}
                  </StyledTableCell>
                  <StyledTableCell align="left">{row.questions}</StyledTableCell>
                  <StyledTableCell align="left">{row.answer}</StyledTableCell>
                  <StyledTableCell align="left">{row.subcategoryID?.subCategoryname}</StyledTableCell>
                  <StyledTableCell align="left">{row.subcategoryID?.categoryID.categoryName}</StyledTableCell>

                  <StyledTableCell align="right">
                    <button onClick={()=>deleteData(row._id)}><DeleteIcon/></button>
                  </StyledTableCell>
                  <StyledTableCell align="right">
                    <button onClick={()=>editData(row._id,row)}><EditIcon/></button>
                  </StyledTableCell>
                </StyledTableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </InteviewPortal>
    </>
  )
}

